                "title": "Emotional Intelligence: Using the Laws of Attraction | D. Ivan Young | TEDxLSCTomball",
                "description": "The \"Laws of Attraction\" are real; inasmuch, there is a Divine Component. Connecting Personality Type to The Laws of Attraction positions you for immediate manifestation of your desires while unleashing your preordained purpose. Your Creator gave you a unique Personality Type for a reason.\n\nThere are many words that describe Dr. D Ivan Young, but here are the few that I chose ‚Äì discerning, enlightened, a spiritual teacher and sagacious philosopher. Seldom does someone possess the ability to connect, at a core level, to impact so many different and varying people. His witty insight into how, and moreover why, people do the things they do is astonishing. Having known Dr. Young for a few years, never have I seen him at a loss for words or searching for an answer. His compassion, his love, and his authentic way of communicating to us exactly what we need to hear and when we need to hear it has profoundly changed my life, and the lives of everyone I‚Äôve witnessed him come in contact with.\n\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at http://ted.com/tedx",
