                "description": "Today we explore some psychology tricks that actually work. These techniques for persuasion can be used any time! Also, these psychology tricks work on anyone and everyone! Use them wisely.\n\nMusic: \"Cute\" and \"Ukulele\" from Bensound.com\n\nThanks to the rest of the TopThink team who worked on this video, including Tristan Reed (writing), Troy W. Hudson (Voice), and Plamen (Animation).",
