                "description": "Humor is something that transcends most barriers. It is a common unification; a concept understood by all. Despite this, there exists a large portion of the population that does not think they can utilize humor. Andrew Tarvin will show you that everyone can use humor. \n\nAndrew Tarvin is the world‚Äôs first Humor Engineer teaching people how to get better results while having more fun. He has worked with thousands of people at 200+ organizations, including P&G, GE, and Microsoft. Combining his background as a project manager at Procter & Gamble with his experience as an international comedian, Andrew‚Äôs program are engaging, entertaining, and most important, effective. He is a best-selling author, has been featured in The Wall Street Journal, Forbes, and TEDx, and has delivered programs in 50 states, 18 countries, and 3 continents. He loves the color orange and is obsessed with chocolate.\n\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at https://www.ted.com/tedx",
