                "title": "How much is enough?  | Kevin Cavenaugh | TEDxPortland",
                "description": "How much is enough? Kevin asks this profound question of our audience. By focusing on three topic areas of wealth, rent & equality ‚Äì he challenges us on how we will choose to change our lives as he bridges the concepts of capitalism and socialism. What will you do with the power of enough? \n\nWith special thanks to core the TEDxPortland organizing team, 70+ volunteers and cherished partners - without you this experience would not be possible. Our event history can be found TEDxPortland.com \n\nIn the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized.\n Kevin is a prolific local developer of small commercial and residential buildings whose work adheres to the mindset that quality is not defined by the depth of one‚Äôs pockets. His developments include the LEED Platinum rated Burnside Rocket, The Zipper, The Ocean, and the nation‚Äôs first ground-up crowdfunded project, the Fair-Haired Dumbbell. Today, he‚Äôs turning his attention toward creating a better version of subsidy-less affordable housing. This talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at https://www.ted.com/tedx",
