                "title": "How to Start a Speech",
                "description": "Subscribe for my new educational videos: http://bit.ly/utube-rhetorical\nCheck out my TED talk (now over 1 million views): \nhttps://www.youtube.com/watch?v=zXCiv4sc5eY \"The Discipline of Finishing: Conor Neill at TEDxUniversidaddeNavarra\" \n-~-~~-~~~-~~-~-\n\nI am Conor Neill. I teach. I share tips. I ask questions. \nI'm a member of EO, President of Vistage in Spain and teach at IESE Business School. Shout out if you've been there or done that ;-)\n\non https://www.facebook.com/rhetorical\non https://twitter.com/conorneill\non https://es.linkedin.com/in/conor\n\nI'd love you to subscribe. My best ideas for videos come from your questions. What is your struggle?\n\nSubscribe for my new educational videos: http://bit.ly/utube-rhetorical\n\nWatch this video and more in the \"Develop Your Speaking Skills\" Playlist: http://bit.ly/speakcourse\n\nI have been teaching Persuasive Communications on MBA courses at IESE Business School for 10 years.  This is part of a collection of short lessons compiled from my courses and shared for use both as a support to my classes, and a way of sharing this valuable knowledge to a wider audience via these awesome digital tools ;-)\n\nVisit my channel for more videos: http://www.youtube.com/user/rhetoricaljourney?feature=mhee\nSubscribe to receive new videos in your feed: http://bit.ly/utube-rhetorical\n\nhttp://www.conorneill.com What are the first words of a speech?  What should be the first sentence of a speech?  How can you engage an audience from the first moment?  There are 3 ways to start a speech.",
